"use strict";(self.webpackChunkway23=self.webpackChunkway23||[]).push([[5989],{40456:(e,p,a)=>{a.r(p),a.d(p,{data:()=>d});const d={key:"v-9ae9e786",path:"/dokku-%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D1%8B-%D0%B4%D0%BB%D1%8F-%D1%83%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F-%D0%BF%D1%80%D0%B8%D0%BB%D0%BE%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F%D0%BC.html",title:"Dokku. Команды для управления приложениями",lang:"ru-RU",frontmatter:{title:"Dokku. Команды для управления приложениями",date:"2017-01-22",categories:["Программы"],tags:["dokku"]},excerpt:"",headers:[{level:2,title:"Список приложений",slug:"список-приложении",children:[]},{level:2,title:"Ручное создание приложений",slug:"ручное-создание-приложении",children:[]},{level:2,title:"Удаление развёрнутых приложений",slug:"удаление-развернутых-приложении",children:[]},{level:2,title:"Переименование развернутого приложения",slug:"переименование-развернутого-приложения",children:[]},{level:2,title:"Ссылки",slug:"ссылки",children:[]}],filePathRelative:"dokku-команды-для-управления-приложениям.md",git:{updatedTime:1692859375e3}}},72204:(e,p,a)=>{a.r(p),a.d(p,{default:()=>s});var d=a(66252),t=a(3577);const o={id:"frontmatter-title",tabindex:"-1"},n=(0,d._)("a",{class:"header-anchor",href:"#frontmatter-title","aria-hidden":"true"},"#",-1),i=(0,d.uE)('<p>Чтобы получить справку по командам для управления приложениями наберите</p><p>dokku apps:help</p><p>Всего доступно четыре команды</p><p>dokku apps # List your apps dokku apps:create # Create a new app dokku apps:destroy # Permanently destroy an app dokku apps:rename # Rename an app</p><h2 id="список-приложении" tabindex="-1"><a class="header-anchor" href="#список-приложении" aria-hidden="true">#</a> Список приложений</h2><p>Для вывода списка приложений наберите команду</p><p>dokku apps</p><p>=====&gt; My Apps node-js-app python-app</p><p>Для отключения вывода дополнительной информации команд Dokku используйте флаг <code>--quiet</code>.</p><p>dokku --quiet apps</p><p>node-js-app python-app</p><h2 id="ручное-создание-приложении" tabindex="-1"><a class="header-anchor" href="#ручное-создание-приложении" aria-hidden="true">#</a> Ручное создание приложений</h2><p>Обычный шаблон создания приложений на Dokku - настройка приложения перед развёртыванием. Для создания приложений используйте команду</p><p>dokku apps:create node-js-app</p><p>Creating node-js-app... done</p><p>После создания вы можете настроить приложение и развернуть его когда все будет готово. Это удобно в случаях если вам нужно:</p><ul><li>Настроить домены и ssl-сертификаты</li><li>Настроить базы данных и связать их приложением</li><li>Установить переменные окружения</li></ul><h2 id="удаление-развернутых-приложении" tabindex="-1"><a class="header-anchor" href="#удаление-развернутых-приложении" aria-hidden="true">#</a> Удаление развёрнутых приложений</h2><p>Если вам нужно удалить приложение используйте команду <code>apps:destroy</code>. Перед любым опасным действием Dokku требует подтверждения. Команда удаление не исключение и попросит еще раз ввести название приложения прежде чем удалить его.</p><p>dokku apps:destroy node-js-app</p><p>! WARNING: Potentially Destructive Action ! This command will destroy node-js-app (including all add-ons). ! To proceed, type &quot;node-js-app&quot;</p><blockquote><p>node-js-app Destroying node-js-app (including all add-ons)</p></blockquote><p>Для того чтобы удалить приложения без подтверждения используйте флаг <code>--force</code></p><p>dokku --force apps:destroy node-js-app</p><p>Destroying node-js-app (including all add-ons)</p><p>Команда удаления приложения удалит все связи сервисов с приложением и все настройки приложения. Но сервисы сохранят свои данные для использования в будущем.</p><h2 id="переименование-развернутого-приложения" tabindex="-1"><a class="header-anchor" href="#переименование-развернутого-приложения" aria-hidden="true">#</a> Переименование развернутого приложения</h2><p>Для переименования развёрнутого приложения используйте команду <code>apps:rename</code>. Приложение должно быть развернуто хотя бы один раз чтобы операция переименования завершилась успешно.</p><p>dokku apps:rename node-js-app io-js-app</p><p>Destroying node-js-app (including all add-ons) -----&gt; Cleaning up... -----&gt; Building io-js-app from herokuish... -----&gt; Adding BUILD_ENV to build environment... -----&gt; Node.js app detected</p><p>-----&gt; Creating runtime environment</p><p>...</p><p>=====&gt; Application deployed: http://io-js-app.ci.dokku.me</p><p>Renaming node-js-app to io-js-app... done</p><p>Эта команда копирует все содержимое приложения в новую директорию с выбранным именем, удаляет старое приложение, собирает и развёртывает новое. Все переменные окружения, включая ссылки на базы данных сохраняются.</p><h2 id="ссылки" tabindex="-1"><a class="header-anchor" href="#ссылки" aria-hidden="true">#</a> Ссылки</h2>',36),r={href:"http://dokku.viewdocs.io/dokku/deployment/application-management/",target:"_blank",rel:"noopener noreferrer"},l=(0,d.Uk)("Документация Dokku"),s={render:function(e,p){const a=(0,d.up)("OutboundLink");return(0,d.wg)(),(0,d.iD)(d.HY,null,[(0,d._)("h1",o,[n,(0,d.Uk)(" "+(0,t.zw)(e.$frontmatter.title),1)]),i,(0,d._)("p",null,[(0,d._)("a",r,[l,(0,d.Wm)(a)])])],64)}}}}]);